#!/usr/bin/env python3

Set_A = {3, 14, 15, 9, 26, 5, 35, 9}
Set_B = {60, 22, 14, 0, 9}

print('Intersection:', Set_A & Set_B)
print('Difference:', Set_A - Set_B)
print('Union:', Set_A | Set_B)
print('Symetrical difference:', Set_A ^ Set_B)

Set_DNA = set('')

print(Set_DNA)

Set_DNA2 = set('')

print(Set_DNA2)
unique_nt = Set_DNA2
print(unique_nt)

seq = ''

nt_dic = {}
for nt in unique_nt:
   # seq.count(nt)
    nt_dic[nt]=seq.count(nt)
print(nt_dic)

total = nt_dic['A']+nt_dic['C']+nt_dic['T']+nt_dic['G']
print(total)
A = nt_dic['A']/total
C = nt_dic['C']/total
T = nt_dic['T']/total
G = nt_dic['G']/total
GC = (nt_dic['C']+nt_dic['G'])/total
print('A nucleotide composition:', '{:.2%}'.format(A))
print('C nucleotide composition:', '{:.2%}'.format(C))
print('T nucleotide composition:', '{:.2%}'.format(T))
print('G nucleotide composition:', '{:.2%}'.format(G))
print('GC content:', '{:.2%}'.format(GC))

        
